import React from "react";
import classNames from 'classnames';
import { Link, useLocation } from 'react-router-dom';
import { useNavigate } from "react-router-dom";

const TABS_LINK = [
    {
        key: 'pemesanan',
        label: 'Pemesanan',
        path: '/kasir/pemesanan',
    },
    {
        key: 'riwayat',
        label: 'Riwayat',
        path: '/kasir/riwayat',
    },
];

export default function TabsKasir() {
    const navigate = useNavigate();
    const handleLogout = () => {
        sessionStorage.clear();
        navigate('/');
        window.location.reload();
    };

    return (
        <div className="flex min-h-full">
            <aside 
                id="default-sidebar" 
                className="sticky top-0 left-0 z-40 w-64 h-full bg-[#B30000] text-white" 
                aria-label="Sidebar"
            >
                <div className="h-full px-3 py-4 overflow-y-auto">
                    <ul className="space-y-2">
                        {TABS_LINK.map((item) => (
                            <li key={item.key}>
                                <TabsLink item={item} />
                            </li>
                        ))}
                        <li>
                            <a 
                                href="#" 
                                onClick={handleLogout} 
                                className="flex items-center p-2 text-base font-normal text-white rounded-lg hover:bg-[#8B0000]"
                            >
                                <span className="flex-1 ml-3 text-center">Logout</span>
                            </a>
                        </li>
                    </ul>
                </div>
            </aside>
        </div>
    );
}

function TabsLink({ item }) {
    const { pathname } = useLocation();

    return (
        <Link 
            to={item.path} 
            className={classNames(
                'flex items-center p-2 text-base font-normal text-white rounded-lg hover:bg-[#8B0000]',
                pathname === item.path ? 'bg-[#699931]' : ''
            )}
        >
            <span className="flex-1 ml-3">{item.label}</span>
        </Link>
    );
}
